<template>
    <div>
        <el-col :span="18">
            <div style="width: 900px; height: 500px;">
                <vue-cropper
                        ref="cropper"
                        img="data:image/jpeg;base64,"
                        :autoCrop="true"
                        :centerBox="true"
                        @realTime="realTimePreview"
                ></vue-cropper>

                <br/>

                <div>
                    <el-button @click="handleStartCrop">开始截图</el-button>

                    <el-button @click="handleRotateLeft">向左旋转90度</el-button>

                    <el-button @click="handleRotateRight">向右旋转90度</el-button>

                    <el-button @click="handleGetCropData">获取截图</el-button>
                </div>

            </div>
        </el-col>
        <el-col :span="6">

            <div :style="previewStyle1">
                <div :style="previews.div">
                    <img :src="previews.url" :style="previews.img">
                </div>
            </div>


            <div>
                <img :src="preview.img">
            </div>
        </el-col>

    </div>
</template>

<script>

    import {VueCropper} from 'vue-cropper'

    export default {
        name: "Home",
        components: {
            VueCropper
        },
        data() {
            return {
                preview: {
                    img: null
                },
                previews: {

                }
            }
        },
        methods: {
            handleStartCrop() {
                this.$refs.cropper.startCrop()
            },
            handleRotateLeft() {
                this.$refs.cropper.rotateLeft()
            },
            handleRotateRight() {
                this.$refs.cropper.rotateRight();
            },
            handleGetCropData() {
                this.$refs.cropper.getCropData(data => {
                    this.preview.img = data;
                })
            },
            realTimePreview(data) {
                console.log(data)
                var previews = data
                var h = 0.5
                var w = 0.2

                this.previewStyle1 = {
                    width: previews.w + "px",
                    height: previews.h + "px",
                    overflow: "hidden",
                    margin: "0",
                    zoom: h
                }


                this.previews = data
            }
        }
    }
</script>

